import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the "Sort and Filter Controls" section using a unique label text
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Find the "List View" button using its icon and aria-label/title
    // Use text selector as a fallback
    let listViewBtn = await page.$('button[title="List View"]');
    if (!listViewBtn) {
      // Try to find by icon class and parent button
      const btns = await page.$$('.view-btn');
      for (const btn of btns) {
        const btnTitle = await btn.getAttribute('title');
        if (btnTitle && btnTitle.toLowerCase().includes('list')) {
          listViewBtn = btn;
          break;
        }
        // Fallback: check for <i> with class "fa-list" inside
        const icon = await btn.$('i.fa-list');
        if (icon) {
          listViewBtn = btn;
          break;
        }
      }
    }

    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Take screenshot before switching
    const beforeSwitch = path.join(screenshotsDir, 'step_2_before_switch.png');
    await page.screenshot({ path: beforeSwitch });
    screenshots.push(beforeSwitch);

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (list view mode)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching
    const afterSwitch = path.join(screenshotsDir, 'step_3_after_switch.png');
    await page.screenshot({ path: afterSwitch });
    screenshots.push(afterSwitch);

    // Extract verification data: check for at least one product-card-list in DOM
    const listCardsCount = await page.$$eval('.product-card-list', els => els.length);

    return {
      success: true,
      action: "Switched to List View Mode by clicking the List View button and verified list layout.",
      extractedData: {
        listCardsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
